import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";

function VanNavBar() {
  return (
    <Navbar expand="lg" className="bg-body-tertiary p-3 shadow">
      <Container>
        <Navbar.Brand href="#home"># Van Life</Navbar.Brand>
        <Nav className="me-start d-flex align-items-center justify-content-between flex-nowrap">
          <Nav.Link href="#home">Home</Nav.Link>
          <Nav.Link href="#link">Link</Nav.Link>
        </Nav>
      </Container>
    </Navbar>
  );
}

export default VanNavBar;
